package org.strobs.utoo.web.services.classes;


public class block_drivers {

	private String booking_number;
	private String block_reason;
	private int status;
	
	public block_drivers() {
		// TODO Auto-generated constructor stub
	}

	public String getBooking_number() {
		return booking_number;
	}

	public void setBooking_number(String booking_number) {
		this.booking_number = booking_number;
	}

	

	public String getBlock_reason() {
		return block_reason;
	}

	public void setBlock_reason(String block_reason) {
		this.block_reason = block_reason;
	}

	public int getStatus() {
		return status;
	}

	public void setStatus(int status) {
		this.status = status;
	}
	
	

}
